import * as React from 'react';
import {Link} from "react-router-dom";
import './sidenav.css';

export function SideNav() {
    const menuElements = [
        {
            title: 'Home',
            path: '/'
        },
        {
            title: 'About',
            path: '/about'
        },
        {
            title: 'Contact',
            path: '/contact'
        }
        // Add more elements if needed
    ];
    return (
        <div>
            <ul>
                {menuElements.map((element, index) => (
                    <li key={index}>
                        <a href={element.path}>{element.title}</a>
                    </li>
                ))}
            </ul>


        </div>
    );
}
